import React from "react";

const Contact = () => {
  return (
    <div className="contact">
      <form action="POST" data-netlify="true">
        <input type="text" name="name" id="name" />
        <input type="email" name="email" id="email" placeholder="Email" />
        <input type="text" name="name" id="name" />
      </form>
    </div>
  );
};

export default Contact;
